import React from 'react';
import {
  Container,
  Button 
} from 'react-bootstrap';

const WelcomeMessage = (props) => {
  return (
    <Container>
    <h1>Welcome to Poll'O</h1>
    <Button
      variant = 'primary'
      onClick = {props.handleClick}
    >
      View Polls
    </Button>
    </Container>
  );
};

export default WelcomeMessage;
